// http://rosalind.info/problems/ling/

#include <iostream>
#include <iomanip>
using namespace std;

inline int newNode(int);
inline int copyNode(int, int);
inline int append(int, int);
int fr;
int len[234234], sl[234234], ln[10][234234];

int main() {
    int v;
    long long z = 1, max_sum = 0, nsub = 0, d = 0;
    string s, nucleo = "ATGC";

    s = "";

    fr = 0;
    v = newNode(0);

    for (int i = 0; i < (int) s.length(); i++) {
        v = append(v, nucleo.find(s[i]));
        nsub += len[v] - len[sl[v]];
    }

    for (int i = 1; i <= (int) s.length(); i++) {
        z *= 4;
        if (z > 123456789)
            z = 123456789;

        d = z;

        if (d > s.length() - i + 1)
            d = s.length() - i + 1;

        max_sum += d;
    }

    cout << fixed << setprecision(10) << 1. * nsub / max_sum << endl;

    return 0;
}

inline int newNode(int l) {
    len[fr] = l;
    for (int i = 0; i < 4; i++)
        ln[i][fr] = -1;
    sl[fr] = -1;
    return fr++;
}

inline int copyNode(int v, int l) {
    len[fr] = l;
    for (int i = 0; i < 4; i++)
        ln[i][fr] = ln[i][v];
    sl[fr] = sl[v];
    return fr++;
}

inline int append(int v, int c) {
    int u = newNode(len[v] + 1);

    while (v >= 0 && ln[c][v] < 0) {
        ln[c][v] = u;
        v = sl[v];
    }

    if (v < 0) {
        sl[u] = 0;
        return u;
    }

    int q = ln[c][v];

    if (len[q] == len[v] + 1) {
        sl[u] = q;
        return u;
    }

    int cp = copyNode(q, len[v] + 1);

    while (v >= 0 && ln[c][v] == q) {
        ln[c][v] = cp;
        v = sl[v];
    }

    sl[u] = sl[q] = cp;
    return u;
}
